function LenCheck(eEvnt, sValue, nLen) {
    if (sValue.length < nLen) {
        return true;
    }
    else {
        return false;
    }
}

function IsNumber(eEvnt, sValue, nLen) {
    var nKeyCode = eEvnt.which || eEvnt.keyCode;
    if (nKeyCode >= 48 && nKeyCode <= 57) {
        if (sValue.length < nLen) {
            return true;
        }
        else {
            return false;
        }
    }
    else {
        return false;
    }
}

function IsAlphaNum(eEvnt, sValue, nLen) {
    var nKeyCode = eEvnt.which || eEvnt.keyCode;
    if ((nKeyCode >= 65 && nKeyCode <= 90) || (nKeyCode >= 97 && nKeyCode <= 122) || nKeyCode == 32 || nKeyCode == 39 || (nKeyCode >= 48 && nKeyCode <= 57)) {
        if (sValue.length < nLen) {
            return true;
        }
        else {
            return false;
        }
    }
    else {
        return false;
    }
}

function IsAlpha(eEvnt, sValue, nLen) {
    var nKeyCode = eEvnt.which || eEvnt.keyCode;
    if ((nKeyCode >= 65 && nKeyCode <= 90) || (nKeyCode >= 97 && nKeyCode <= 122) || nKeyCode == 32) {
        if (sValue.length < nLen) {
            return true;
        }
        else {
            return false;
        }
    }
    else {
        return false;
    }
}

function IsAlphaApos(eEvnt, sValue, nLen) {
    var nKeyCode = eEvnt.which || eEvnt.keyCode;
    if ((nKeyCode >= 65 && nKeyCode <= 90) || (nKeyCode >= 97 && nKeyCode <= 122) || nKeyCode == 32 || nKeyCode == 39) {
        if (sValue.length < nLen) {
            return true;
        }
        else {
            return false;
        }
    }
    else {
        return false;
    }
}

function isNumberKey(evt) {
    var charCode = (evt.which) ? evt.which : evt.keyCode;
    if (charCode != 46 && charCode > 31 && (charCode < 48 || charCode > 57))
        return false;
}

function ConvPr(Id) {
    var numb = document.getElementById(Id).value;
    var zz = parseFloat(numb) || 0;
    var zzz = zz.toFixed(2);
    document.getElementById(Id).value = zzz;
}

